using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class StructureEFRTDoubleDeckInputModel : Notifier	{		public StructureEFRTDoubleDeckInputModel()		{					TankID = "";			TankHeight = "";		}				private string _TankID;		public string TankID			{				get { return _TankID; }				set				{					_TankID = value;					OnPropertyChanged(nameof(TankID));				}			}				private string _TankHeight;		public string TankHeight			{				get { return _TankHeight; }				set				{					_TankHeight = value;					OnPropertyChanged(nameof(TankHeight));				}			}			}}